INSERT INTO `t_company_wiki` VALUES (1,1233722202517368832,'Vue (读音 /vjuː/，类似于 view) 是一套用于构建用户界面的渐进式框架','<p>Vue (读音 /vjuː/，类似于&nbsp;<span style=\"color: rgb(39, 56, 73);\">view</span>) 是一套用于构建用户界面的<span style=\"color: rgb(39, 56, 73);\">渐进式框架</span>。与其它大型框架不同的是，Vue 被设计为可以自底向上逐层应用。Vue 的核心库只关注视图层，不仅易于上手，还便于与第三方库或既有项目整合。另一方面，当与<a href=\"https://cn.vuejs.org/v2/guide/single-file-components.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(66, 185, 131);\">现代化的工具链</a>以及各种<a href=\"https://github.com/vuejs/awesome-vue#libraries--plugins\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(66, 185, 131);\">支持类库</a>结合使用时，Vue 也完全能够为复杂的单页应用提供驱动。</p><p>如果你想在深入学习 Vue 之前对它有更多了解，我们<a href=\"https://cn.vuejs.org/v2/guide/#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(66, 185, 131);\">制作了一个视频</a>，带您了解其核心概念和一个示例工程。</p><p>如果你已经是有经验的前端开发者，想知道 Vue 与其它库/框架有哪些区别，请查看<a href=\"https://cn.vuejs.org/v2/guide/comparison.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(66, 185, 131);\">对比其它框架</a>。</p><p>如果你已经是有经验的前端开发者，想知道 Vue 与其它库/框架有哪些区别，请查看<a href=\"https://cn.vuejs.org/v2/guide/comparison.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); color: rgb(66, 185, 131);\">对比其它框架</a>。</p><h1>Header1</h1><h2 class=\"ql-align-center\">Header2</h2><p>Hello,My name is Darcy~~</p><p><img src=\"https://worldelite-debug.oss-cn-shanghai.aliyuncs.com/pic/077b2bc849d24c379aafc5e3b46d2013.jpg\" style=\"display: block; margin: auto;\" width=\"677\"></p>','2020-04-01 09:51:13','2020-04-01 09:51:13'),(2,1225689620697460736,'','<p>Vue (读音 /vjuː/，类似于&nbsp;<span style=\"color: rgb(39, 56, 73);\">view</span>) 是一套用于构建用户界面的<span style=\"color: rgb(39, 56, 73);\">渐进式框架</span>。与其它大型框架不同的是，Vue 被设计为可以自底向上逐层应用。Vue 的核心库只关注视图层，不仅易于上手，还便于与第三方库或既有项目整合。另一方面，当与<a href=\"https://cn.vuejs.org/v2/guide/single-file-components.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(66, 185, 131);\">现代化的工具链</a>以及各种<a href=\"https://github.com/vuejs/awesome-vue#libraries--plugins\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(66, 185, 131);\">支持类库</a>结合使用时，Vue 也完全能够为复杂的单页应用提供驱动。</p><p>如果你想在深入学习 Vue 之前对它有更多了解，我们<a href=\"https://cn.vuejs.org/v2/guide/#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(66, 185, 131);\">制作了一个视频</a>，带您了解其核心概念和一个示例工程。</p><p>如果你已经是有经验的前端开发者，想知道 Vue 与其它库/框架有哪些区别，请查看<a href=\"https://cn.vuejs.org/v2/guide/comparison.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(66, 185, 131);\">对比其它框架</a>。</p>','2020-04-01 10:05:00','2020-04-01 10:05:00');
