or: black;\">用户制作、评论、发布、传播的内容（包括但不限于上传至               WorldElite       平台的未公开的私密内容）应自觉遵守法律法规、社会主义制度、国家利益、公民合法权益、社会公共秩序、道德风尚和信息真实性等要求，否则我们将立即采取相应处理措施。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">用户不得发表下列信息：</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（1）反对宪法确定的基本原则的;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（2）危害国家安全、泄露国家秘密;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（3）颠覆国家政权、推翻社会主义制度、煽动分裂国家、破坏国家统一的;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（4）损害国家荣誉和利益的;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（5）宣传恐怖主义、极端主义的;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（6）宣扬民族仇恨、民族歧视、破坏民族团结的;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（7）煽动地域歧视、地域仇恨的;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（8）破坏国家宗教政策、宣扬邪教和迷信的;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（9）编造、散布谣言、虚假信息，扰乱社会秩序，破坏社会稳定的;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（10）散布、传播淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font