lor: black;\">4.您确认并同意授权我们以我们自己的名义或委托专业第三方对侵犯您上传发布的享有知识产权的内容进行代维权，维权形式包括但不限于：监测侵权行为、发送维权函，提起诉讼或仲裁、调解、和解等，我们有权对维权事宜做出决策并独立实施。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">5.我们为               WorldElite       开发、运营提供技术支持，并对               WorldElite       及相关服务的开发和运营等过程中产生的所有数据和信息等享有全部权利。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">6.请您在任何情况下都不要私自使用我们的包括但不限于               WorldElite       等在内的任何商标、服务标记、商号、域名、网站名称或其他显着品牌特征等（以下统称为“标识”）。未经我们事先书面同意，您不得将本条款前述标识以单独或结合任何方式展示、使用或申请注册商标、进行域名注册等，也不得实施向他人明示或暗示有权展示、使用、或其他有权处理该些标识的行为。由于您违反本协议使用我们上述商标，标识等给我们或他人造成损失的，由您承担全部法律责任。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">第十一条 隐私政策</p>\n<pre data-tool=\"mdnice编辑器\" style=\"margin-top: 10px; margin-bottom: 10px;\"><code style=\"display: -webkit-box; font-family: Operator Mono, Consolas, Monaco, Menlo, monospace; border-radius: 0px; font-size: 12px; -webkit-overflow-scrolling: touch;\">           WorldElite       非常重视用户信息的保护，在使用               WorldElite       及相关服务前，我们可能会收集和使用您的相关信息，请您务必仔细阅读本隐私政策。您一旦选择使用               WorldElite       及相关服务，即意味着同意我们按照本隐私政策收集、使用（含商业合作使用）、储存和分享您的相关信息。\n</code></pre>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">1.信息可能收集的范围与方式如下：</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（1）我们提供服务时，可能会收集，储存和使用下列与您有关的信息。如果您不提供相关信息，无法可能注册成为               WorldElite       的用户或无法享受我们提供的某些服务，或者无法达到相关服务拟达到的效果。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（2）您理解并同意，当您使用               WorldElite       及相关服务时填写和/或提供的信息，可能包括姓名、性别、联系方式等单独或者结合识别用户身份的信息。您可以选择不提供某一或某些信息，但是这样可能使您无法使用               WorldElite       的相关特殊服务。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">2.我们因您使用               WorldElite       及相关服务而获取的信息如下：\n（1）当您使用               WorldElite       产品或服务时，为使您获得更轻松的访问体验，我们可能会使用各种技术来收集和存储信息，在此过程中可能会向您的设备发送一个或多个的Cookie或匿名标识符。这么做是为了了解您的使用习惯，使您省去重复输入注册信息等步骤，或帮助判断您的账户安全。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（2）当您使用               WorldElite       或服务时，我们可能会利用Cookie和同类技术收取您的信息用于了解您的偏好，进行咨询或数据分析、改善产品服务即用户体验、提高广告效果、及时发现并防范安全风险、为用户和合作伙伴提供更好的服务。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（3）我们不会将Cookie用于本隐私政策所述目的之外的任何用途，您可以根据自己的偏好留存或删除Cookie。您可清除软件或网页中保存的所有Cookie，当您手动清除后，您的相关信息即已删除。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">3.某些移动设备或应用包含唯一应用程序编号。例如您使用的移动设备，浏览器或您使用的用于接入               WorldElite       服务的其他程序所提供的配置信息、设备版本号和设备识别码、IP地址等。为了提供更好的服务与改善用户体验，我们可能会记录硬件型号、操作系统版本号、国际移动设备身份码（ IMEI）、网络设备硬件地址（MAC）等信息。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">4.当您开启设备定位功能并使用               WorldElite       基于位置提供的相关服务时，系统会通过GPS或WLAN等方式自动处理有关设备的位置信息，以使得您不需要手动输入自身地理坐标就可获得相关服务。您可以通过关闭定位功能，停止               WorldElite       对您的地理位置信息的收集（大多数移动设备将允许您关闭定位服务，具体建议您联系您的移动设备的服务商或生产商）。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">5.通过使用收集的信息，我们会得以向您提供个性化的服务并改善现有服务。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">6.通过使用收集的信息，向您提供更加相关广告以替代普遍投放的广告。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">7.可能我们会与其他合作方共同向您提供服务或内容。在服务或内容为该项产品 /服务所必须的情况下，您同意我们可与其分享您的个人信息，并且我们将努力确保该第三方在使用您的个人信息时同时遵守本隐私政策以及其他的保密及安全义务。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">8.我们不对外公开或向第三方提供用户的个人信息，但下列情况除外：</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（1）事先获得您的明确授权;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（2）您分享的信息;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（3）根据有关的法律法规或按照司法，行政等国家机关的要求;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（4）出于实现我们对您个人信息合理使用的目的，或为履行本协议相关条款的规定或本隐私政策中的义务和行使我们的权利，向我们的关联方、合作伙伴或代表我们履行某项职能的第三方（例如代表我们发出推送通知的通讯服务商等）分享您的个人信息;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（5）以维护公共利益或学术研究为目的;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（6）为维护               WorldElite       其他用户、我们及第三方的合法权益，例如查找、预防、处理欺诈或安全方面的问题;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（7）我们为维护合法权益而向用户提起诉讼或仲裁;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（8）在涉及合并、分立、收购、资产转让或类似的交易时，如涉及到个人信息转让，我们会要求新的持有您的个人信息的第三方继续受本隐私政策的约束，否则，我们有权要求第三方重新取得您的授权同意;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（9）符合本用户协议相关条款的规定。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">9.我们非常重视信息安全，我们努力为您的信息安全提供保障，以防止您的信息被不当使用或被未经授权的访问、使用或泄漏。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">10.我们将在合理和安全水平内使用各种安全保护措施，例如我们会使用加密技术、匿名化处理等手段保护您的个人信息。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">11.我们建立专门的数据安全部门、安全管理制度等保障您的个人信息安全。采取严格的数据使用和访问制度，采取专门的数据和技术安全审计。对个人信息泄露等安全事件，我们会启动应急预案，阻止安全事件扩大，并以推送，公告等形式告知您。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">12.尽管已经采取了上述合理有效措施，并已经遵守了相关法律规定要求的标准，但请您理解，由于技术的限制以及可能存在的各种恶意手段，在互联网行业，即便竭尽所能加强安全措施，也不可能始终保证信息百分之百的安全。您需要了解，您接入我们的服务所用的系统和通讯网络，有可能因我们可控范围外的因素而出现问题。因此，您应采取积极措施保护个人信息的安全，如：定期修改密码，不将自己的账号密码等个人信息透露给他人知悉。               WorldElite       提供的个人信息保护措施仅适用于               WorldElite       平台，一旦您离开               WorldElite       ，浏览或使用其他网站、服务及内容资源，               WorldElite       没有能力及义务保护你在               WorldElite       之外的网站提交的任何个人信息，无论你登录或浏览上述网站是否基于               WorldElite       的链接或引导。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">13.本隐私政策条款不适用于以下情况：</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（1）通过               WorldElite       及相关服务而接入的第三方服务（包括任何第三方应用及网站）收集的信息;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">通过在               WorldElite       及相关服务中进行广告服务的其他机构、组织所收集的信息。</p>\n<p data