bottom: 8px; margin: 0; line-height: 26px; color: black;\">要增强自护意识，不随意约会网友;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">要维护网络安全，不破坏网络秩序;</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">要有益身心健康，不沉溺虚拟时空。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">5.为更好的保护未成年人隐私权益，我们提醒用户慎重发布包含未成年人的内容，一经发布，即视为用户同意              WorldElite       展示未成年人的信息、肖像、声音等，且允许               WorldElite       依据本协议使用，处理该等与未成年人相关的内容。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">第十五条 其他</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">1.本协议的成立、生效、履行、解释及争议的解决均应适用中华人民共和国大陆地区法律。倘本协议之任何规定因与中华人民共和国大陆地区的法律抵触而无效，则这些条款将尽可能接近本协议原条文意旨重新解析，且本协议其它规定仍应具有完整的效力及效果。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">2.本协议的签署地点为中华人民共和国四川省自由贸易试验区。若您与我们发生争议的，双方应尽量友好协商解决，协商不成，您同意应将争议提交至四川省自由贸易试验区法院管辖。</p>\n<p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">3.我们有权依据国家政策、技术条件、产品功能等变化需要而进行修改本协议，我们会将修改后的协议予以发布。前述内容一经正式发布，并以适当的方式送达用户（网站公布，系统通知等），即为本协议不可分割的组成部分，您应同样遵守。您对修改后的协议有异','2020-04-16 07:56:23','2020-04-16 07:56:23');
