  `job_type` int(11) NOT NULL DEFAULT '0' COMMENT '招聘类型',
  `name` varchar(40) NOT NULL DEFAULT '' COMMENT '名字',
  `category_id` int(11) NOT NULL DEFAULT '0' COMMENT '类型',
  `depart` varchar(45) NOT NULL DEFAULT '' COMMENT '所属部门',
