INSERT INTO `t_job` VALUES (1227794894950408192,1225689620697460736,1227385762795638784,1,'全职工程师',143,'','<p>我们支持远程工作，你的工作可以在家完成，当然我们也有个小的办公室在广州天河，你也可以过来这里；全职或者兼职都可以接受，只要能把工作任务交付就行。</p><p><br></p><p>接受在校学生，但要有比较多的空余时间，当然，能力达标是基础条件哈。</p><p><br></p><p># 任职资格：</p><p><br></p><p>1、音乐专业背景，有扎实的音乐基础，对流行音乐有一定的研究；</p><p>2、具有文字编辑能力，文字功底好，要求提供相关作品；</p><p>3、细心、细致、有耐心、对产出高质量内容有强烈热情。</p>',3,7,12,17,4,1,'',3,'2019-03-01 05:44:47','2019-02-13 03:21:28','2020-04-19 08:55:05',0,''),(1228516056290426880,1225689620697460736,1227385762795638784,107,'数据分析师',62,'','<p><span style=\"color: rgb(97, 104, 124);\">平安普惠金融业务集群（简称“平安普惠”）历经十一年发展，秉承“每一个客户都是值得信赖的”品牌理念，以创新的科技和卓越客户体验向社会传递“普惠精神”。为广大小企业和个人客户提供更加优质的服务。未来将成为中国最大的消费金融服务提供商之一！</span></p><p><span style=\"color: rgb(97, 104, 124);\">岗位职责：</span></p><p><span style=\"color: rgb(97, 104, 124);\">1、负责统计相关的分析工作，队数据进行收集，分析和利用，编制分析报告</span></p><p><span style=\"color: rgb(97, 104, 124);\">2、负责中心部分各类指标的月度、季度、</span></p><p><span style=\"color: rgb(97, 104, 124);\">年度的统计，报表的制作，编写并随时答复领导市场数据动态情况</span></p><p><span style=\"color: rgb(97, 104, 124);\">3、协助总监处理部分内部事务，各部内部会议，数据支持等工作</span></p><p><span style=\"color: rgb(97, 104, 124);\">任职要求：</span></p><p><span style=\"color: rgb(97, 104, 124);\">1、本科以上学历，数学，统计学，计算机等专业</span></p><p><span style=\"color: rgb(97, 104, 124);\">2、熟悉办公软件，对数据敏感，熟悉数据分析工具</span></p><p><span style=\"color: rgb(97, 104, 124);\">3、逻辑性强，具有良好的学习能力和抗压能力</span></p>',2,8,13,14,4,1,'',2,'2020-02-15 03:07:07','2020-02-15 03:07:07','2020-02-17 04:31:08',0,''),(1228516288759726080,1225689620697460736,1227385762795638784,1,'产品经理',143,'','<p><span style=\"color: rgb(97, 104, 124);\">加入平安普惠，为梦想奋斗</span></p><p><span style=\"color: rgb(97, 104, 124);\">专营小微企业主及个人借款金融服务</span></p><p><span style=\"color: rgb(97, 104, 124);\">助力小微企业发展 解决资金困境</span></p><p><span style=\"color: rgb(97, 104, 124);\">金融产品知识答疑 愉悦赚钱就业</span></p><p><span style=\"color: rgb(97, 104, 124);\">六险二金福利保障 行业前景向好</span></p><p><span style=\"color: rgb(97, 104, 124);\">平安普惠邀你加入 人才储备等你</span></p><p><span style=\"color: rgb(97, 104, 124);\">曲成双团队 宣聘</span></p>',2,8,13,14,6,0,'',2,'2020-02-15 03:08:03','2020-02-15 03:08:02','2020-02-15 03:08:02',0,''),(1228516595115884544,1225689620697460736,1227385762795638784,1,'客服专员/助理',254,'','<p><span style=\"color: rgb(97, 104, 124);\">2、招聘网站维护与管理；3、对现有招聘渠道进行分析管理，并不断拓展新的招聘渠道；4、负责公司招聘渠道的维护、开发、筛选，负责招聘信息的发布、更新，负责与招聘相关机构的联系。5、负责简历初选、面试通知及面试时间安排。6、建立公司人才库，做好人才的储备和选拔；7、完成公司岗位的</span></p>',2,8,13,14,4,0,'',2,'2020-02-15 03:09:16','2020-02-15 03:09:15','2020-02-15 03:09:15',0,''),(1228534001569796096,1225689620697460736,1227385762795638784,1,'客服专员/助理',254,'','<p><span style=\"color: rgb(97, 104, 124);\">2、招聘网站维护与管理；3、对现有招聘渠道进行分析管理，并不断拓展新的招聘渠道；4、负责公司招聘渠道的维护、开发、筛选，负责招聘信息的发布、更新，负责与招聘相关机构的联系。5、负责简历初选、面试通知及面试时间安排。6、建立公司人才库，做好人才的储备和选拔；7、完成公司岗位的</span></p>',2,8,13,14,4,0,'',3,'2020-02-15 04:18:26','2020-02-15 04:18:25','2020-03-01 05:44:56',0,''),(1228534004623249408,1225689620697460736,1227385762795638784,1,'客服专员/助理',254,'','<p><span style=\"color: rgb(97, 104, 124);\">2、招聘网站维护与管理；3、对现有招聘渠道进行分析管理，并不断拓展新的招聘渠道；4、负责公司招聘渠道的维护、开发、筛选，负责招聘信息的发布、更新，负责与招聘相关机构的联系。5、负责简历初选、面试通知及面试时间安排。6、建立公司人才库，做好人才的储备和选拔；7、完成公司岗位的</span></p>',2,8,13,14,4,0,'',2,'2020-02-15 04:18:26','2020-02-15 04:18:26','2020-02-15 04:18:26',0,''),(1228534007420850176,1225689620697460736,1227385762795638784,1,'客服专员/助理',254,'','<p><span style=\"color: rgb(97, 104, 124);\">2、招聘网站维护与管理；3、对现有招聘渠道进行分析管理，并不断拓展新的招聘渠道；4、负责公司招聘渠道的维护、开发、筛选，负责招聘信息的发布、更新，负责与招聘相关机构的联系。5、负责简历初选、面试通知及面试时间安排。6、建立公司人才库，做好人才的储备和选拔；7、完成公司岗位的</span></p>',2,8,13,14,4,0,'',2,'2020-05-07 14:23:42','2020-02-15 04:18:27','2020-05-07 14:23:42',0,''),(1228534010352668672,1225689620697460736,1227385762795638784,1,'客服专员/助理',254,'','<p><span style=\"color: rgb(97, 104, 124);\">2、招聘网站维护与管理；3、对现有招聘渠道进行分析管理，并不断拓展新的招聘渠道；4、负责公司招聘渠道的维护、开发、筛选，负责招聘信息的发布、更新，负责与招聘相关机构的联系。5、负责简历初选、面试通知及面试时间安排。6、建立公司人才库，做好人才的储备和选拔；7、完成公司岗位的</span></p>',2,8,13,14,4,0,'',2,'2020-02-15 04:18:28','2020-02-15 04:18:27','2020-02-15 04:18:27',0,''),(