正，有责任心和上进心</p>\n<p>5、思想端正，有责任心和上进心</p>',2,5,6,14,4,4,'',3,'2020-03-20 07:21:11','2020-03-20 06:46:37','2020-03-20 14:10:26',0,'没有理由~'),(1240912019613237248,1225689609813241856,1240854719196254208,107,'AAAA',3,'','<p>未来需要你做的是：</p>\n<p>1.负责课程配套的用户社群运营与服务支持，并通过设定群规、策划话题、群内活动、分享等运营方式保持社群的活跃度与粘性，提升用户体验与收获，提高复购率与口碑；</p>\n<p>2.负责付费课程上架与更新工作，维护课程评论区；</p>\n<p>3.协助微信公号的运营与推送工作；</p>\n<p>4.协助运营活动的策划与执行；</p>\n<p>5.上级交代的其他事情。</p>\n<p>我们期望遇见这样的你：</p>\n<p>1.对互联网行业以及知识付费领域感兴趣，并有初步的理解和了解；</p>\n<p>2.有较强的沟通能力，有耐心，亲和力强；</p>\n<p>3. 喜欢与用户打交道，并能根据用户的反馈，针对用户的拉新、留存、转化等，提出自己的想法与建议；</p>\n<p>4.细心，参与或有运营过课程社群训练营者优先；</p>',1,6,8,18,4,4,'',3,'2020-03-20 08:04:15','2020-03-20 08:04:15','2020-05-07 14:11:05',0,''),(1256778389190070272,1225689620697460736,1227385762795638784,108,'这是一个新岗位',3,'','<p>没有要求，没有理由~~</p>\n<p>没有要求，没有理由~~</p>\n<p>没有要求，没有理由~~</p>\n<p>没有要求，没有理由~~</p>',2,5,8,NULL,5,1,'广州天河区',2,'2020-05-03 02:51:32','2020-05-03 02:51:32','2020-05-12 08:19:21',0,''),(1261159440976850944,1225689620697460736,1227385762795638784,107,'产品经理',153,'','<p>没有智者</p>',1,5,7,0,4,0,'广州天河',2,'2020-05-15 05:00:17','2020-05-15 05:00:16','2020-05-15 05:00:16',0,''),(1261225339058540544,1225689620697460736,1227385762795638784,107,'这是个新职位',4,'','<p>职位描述</p>',1,6,8,15,5,0,'深圳欢乐谷',2,'2020-05-15 09:22:08','2020-05-15 09:22:07','2020-05-15 09:22:07',0,''),(1261225735218941952,1225689620697460736,1227385762795638784,107,'测试消息通知',3,'','<p>这是一份新工作</p>',1,4,6,16,4,0,'广州天河',2,'2020-05-15 09:23:42','2020-05-15 09:23:42','2020-05-15 09:23:42',0,''),(1261226400465022976,1225689620697460736,1227385762795638784,107,'测试消息通知',3,'','<p>这是一份新工作</p>',1,4,6,16,4,0,'广州天河',2,'2020-05-15 09:26:21','2020-05-15 09:26:20','2020-05-15 09:26:20',0,''),(1261226764979400704,1225689620697460736,1227385762795638784,107,'测试新职位通知',153,'','<p>这是职位描述</p>',1,7,8,17,5,0,'深圳福田',2,'2020-05-15 09:27:48','2020-05-15 09:27:47','2020-05-15 09:27:47',0,''),(1261227071549468672,1225689620697460736,1227385762795638784,107,'测试新职位通知',160,'','<p>这是职位描述</p>',1,6,8,0,6